import React from "react";
import "./categories.css";
import { Link } from "react-router-dom";

export default function Categories() {
  return (
    <div className="container">
      <div className="subforum">
        <div className="subforum-title">
          <h1>HowTo:</h1>
        </div>
        <div className="subforum-row">
          <div className="user-icon">
            <img src="img/user.png"></img>
          </div>
          <div className="subforum-description">
            <h1><a href=''>Description Title:</a></h1>
            <p>Description Concent: just anything lmaooo wassup my boys</p>
          </div>
          <div className='subforum-'></div>
        </div>
      </div>
    </div>
  );
}
